import React from 'react';
import ReactDOM from 'react-dom';

const firstName = "Sakshi";
const lastName = "Das";
const newDate = new Date();
ReactDOM.render(<>
    <h1> {`My name is ${firstName} ${lastName}`}</h1>
    <p>{`Current Date is ${newDate.getDate()}-${newDate.getMonth()+1}-${newDate.getYear()}`}</p>
    <p>{`Cuurent Time is ${newDate.getHours()}: ${newDate.getMinutes}: ${newDate.getSeconds}`}</p>
</>, document.getElementById("root"))
